data.pipeline.conf:
input {
  jdbc {
    jdbc_driver_library => "/usr/share/logstash/logstash-core/lib/jars/mongo-java-driver-3.12.11.jar"
    jdbc_driver_class => "com.mongodb.client.MongoDriver"
    jdbc_connection_string => "mongodb://${MONGO_USER}:${MONGO_PASSWORD}@mongo.mongo.svc.cluster.local:27017/ka0s?authSource=admin"
    jdbc_user => "${MONGO_USER}"
    statement => "db.getSiblingDB('ka0s').ka0s.find()"
    schedule => "* * * * *"
  }
}
output {
  elasticsearch {
    hosts => ["http://elasticsearch.elastic.svc.cluster.local:9200"]
    index => "kaos-%{+YYYY.MM.dd}"
  }
}

